    const GameStart = () => {
        props.setGame({game: "snake"});

    };

    return (
        <>
            <h1>Game</h1>
            <label>SnakeGame{'  '}<button onClick={GameStart} value="snake">Start</button></label>

        </>
    );
};

export default StartMenu;
